import React from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview, name}) {


	return (
		<View>
			<Image
              	source={{
                width: 100,
                height: 100,
                uri: preview}}
              />
			<View>
			{
				name.map((name, i) => 
					<Text>
					{name}	
					</Text>
					)
			}
			</View>
		</View>

		)
}

export default KatsItem;
